import React from 'react'
import './Navigation.scss'

function Navigator() {
    return (
        <div className='navbar navbar-expand-lg navbar-dark container'>
            <img src="https://img.icons8.com/flat_round/35/000000/owl--v1.png" alt='img' />
            <a className='navbar-brand' href='/'>My Prilozhenie</a>
        </div>
    )
}

export default Navigator
